#!/usr/bin/env python# encoding: utf-8import os, base64def decode_base64(data):    missing_padding = len(data) % 4    if missing_padding != 0:        data += b'='*(4 - missing_padding)    return base64.b64decode(data)def generate_pic(pic_name,pic_data):    pic_data = pic_data.split(",",1)[1]    imgdata = decode_base64(pic_data)    file = open(pic_name,'wb')    file.write(imgdata)    file.close()if __name__ == "__main__":#    temp = "data:image/png;base64,"#    temp = "data:image/png;base64,"    temp = "data:image/png;base64,"    generate_pic("heihei.png", temp)